tables.table_schema:
CREATE TABLE inventory_levels (
  product_id INT PRIMARY KEY,
  stock_quantity INT,
  warehouse_id INT
);

CREATE TABLE warehouses (
  warehouse_id INT PRIMARY KEY,
  location TEXT,
  temperature FLOAT,
  humidity FLOAT
);

CREATE TABLE Warehouse (
    warehouse_id INT PRIMARY KEY,
    location VARCHAR,
    capacity INT
);

CREATE TABLE Product (
    product_id INT PRIMARY KEY,
    name VARCHAR,
    category VARCHAR
);
